import React, {useState} from 'react';
import Cards from '../../components/CardItem/Cards';
import './Games.css';
import {SUButton} from '../../components/ButtonElement';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import { ArrowForward, ArrowRight} from '../../components/HeroSection/HeroElements';

//Navbar
import Navbar from '../../components/Navbar/Navbar';
import Sidebar from '../../components/Sidebar/Sidebar';

const Games = () => {

    return (
        <>   
            <Cards />
            <h3>Your game not found in our library? Make a suggestion <a href="/suggestion">here</a>.</h3>
            
        </>
    );
};

export default Games;
